		std::string Menu::FilterName(std::string name)
		{
			std::string ret;
			bool was_last_letter_hash = false;
			for (auto letter : name)
			{
				ret.push_back(letter);

				if (letter == '#')
				{
					if (was_last_letter_hash)
					{
						ret.pop_back();
						ret.pop_back();
						break;
					}

					was_last_letter_hash = true;
				}
			}

			return ret;
		}
